{"cells":[{"source":"<a href=\"https://www.kaggle.com/estherreginaldyeboah/bellabeat-fitness-market-growth?scriptVersionId=90204648\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"49d88868","metadata":{"papermill":{"duration":0.068746,"end_time":"2022-03-15T19:09:39.038954","exception":false,"start_time":"2022-03-15T19:09:38.970208","status":"completed"},"tags":[]},"source":[]},{"cell_type":"markdown","id":"cff07924","metadata":{"papermill":{"duration":0.061787,"end_time":"2022-03-15T19:09:39.163246","exception":false,"start_time":"2022-03-15T19:09:39.101459","status":"completed"},"tags":[]},"source":["#  **Bellabeat Business Task**\n","Bellabeat’s ultimate goal is to find opportunities to grow in the smart device industry tailored to women. The task here is to analyze and find trends in smart device **usage** in the general smart device industry market. That is, what is the most common or frequent aspect of smart device users’ daily lives they currently pay attention to? In addition, bellabeat being a woman focused company, do these trends found apply to only women, men or both genders. Finally, when we find that trend, which one among the bellabeat products can these insights be applied?  And, what should be done to this product so that it can be used as tool to grow bellabeat market in the industry?\n","\n","**Deliverables**\n","The following deliverables will be produced in a report:\n","1. A clear summary of the business task \n","2. A description of all data sources used \n","3. Documentation of any cleaning or manipulation of data \n","4. A summary of your analysis\n","5. Supporting visualizations and key findings \n","6. Your top high-level content recommendations based on your analysis\n","\n","This report will be delivered to the stakeholders:\n","1.    Urška Sršen: Bellabeat’s cofounder and Chief Creative Officer\n","2.    Sando Mur: Mathematician and Bellabeat’s cofounder; key member of the Bellabeat executive team\n","3.    Bellabeat marketing analytics team: A team of data analysts responsible for collecting, analyzing, and\n","reporting data that helps guide Bellabeat’s marketing strategy.\n"]},{"cell_type":"code","execution_count":1,"id":"63be5b01","metadata":{"_cell_guid":"b1076dfc-b9ad-4769-8c92-a6c4dae69d19","_uuid":"8f2839f25d086af736a60e9eeb907d3b93b6e0e5","execution":{"iopub.execute_input":"2022-03-15T19:09:39.295594Z","iopub.status.busy":"2022-03-15T19:09:39.292903Z","iopub.status.idle":"2022-03-15T19:09:40.76839Z","shell.execute_reply":"2022-03-15T19:09:40.766332Z"},"papermill":{"duration":1.541592,"end_time":"2022-03-15T19:09:40.768567","exception":false,"start_time":"2022-03-15T19:09:39.226975","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n","here() starts at /kaggle/working\n","\n","\n","Attaching package: ‘janitor’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    chisq.test, fisher.test\n","\n","\n"]}],"source":["library(tidyverse)\n","library(lubridate)\n","library(dplyr)\n","library(ggplot2)\n","library(tidyr)\n","library(here)\n","library(skimr)\n","library(janitor)"]},{"cell_type":"markdown","id":"a6d9d63a","metadata":{"papermill":{"duration":0.07075,"end_time":"2022-03-15T19:09:40.912445","exception":false,"start_time":"2022-03-15T19:09:40.841695","status":"completed"},"tags":[]},"source":["# **Prepare**\n","This dataset was created and last updated on 16th December, 2020. I was published by Mobius a Kaggle user on the Kaggle Datasets collections. This dataset has been preprocessed and licensed by CC0:Public Domain for public use. However, the data contained in the dataset was originally collected from FitBit fitness customers for FitBit Fitness Tracker company. \n","\n","The Dataset contains 18 files generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. Individual reports can be parsed by export session ID (column A) or timestamp (column B). Variation between output represents use of different types of Fitbit trackers and individual tracking behaviors / preference.\n","\n","Reference\n","Furberg, Robert; Brinton, Julia; Keating, Michael ; Ortiz, Alexa\n","https://zenodo.org/record/53894#.YMoUpnVKiP9\n","\n","**Problems with data**\n","\n","Not every part of the data completes the 30 users that responded to the survey.Files like 'heartrate_seconds_merged.csv' contains 14 Unique Ids instead of 30.\n","Also, the Unique Ids in most of the files are 33 instead of 30. I searched for duplicates but realized there are uniques Ids. Therefore, it's save to assume that 33 users responded instead of 30 or perhaps, 1 user had multiple tracking device.\n","It is good to also take note that since FitBit is not tailored to just women, these data may have been from a male dominated responses or at least male minority or majority responses.\n","We do not have details about the column names.\n"]},{"cell_type":"code","execution_count":2,"id":"14c9f29c","metadata":{"execution":{"iopub.execute_input":"2022-03-15T19:09:41.094489Z","iopub.status.busy":"2022-03-15T19:09:41.061944Z","iopub.status.idle":"2022-03-15T19:09:41.427569Z","shell.execute_reply":"2022-03-15T19:09:41.426521Z"},"papermill":{"duration":0.441166,"end_time":"2022-03-15T19:09:41.427726","exception":false,"start_time":"2022-03-15T19:09:40.98656","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[1mRows: \u001b[1m\u001b[22m\u001b[34m\u001b[34m940\u001b[34m\u001b[39m \u001b[1m\u001b[1mColumns: \u001b[1m\u001b[22m\u001b[34m\u001b[34m15\u001b[34m\u001b[39m\n","\n","\u001b[36m──\u001b[39m \u001b[1m\u001b[1mColumn specification\u001b[1m\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m  (1): ActivityDate\n","\u001b[32mdbl\u001b[39m (14): Id, TotalSteps, TotalDistance, TrackerDistance, LoggedActivitiesDi...\n","\n","\n","\u001b[36mℹ\u001b[39m Use \u001b[30m\u001b[47m\u001b[30m\u001b[47m`spec()`\u001b[47m\u001b[30m\u001b[49m\u001b[39m to retrieve the full column specification for this data.\n","\u001b[36mℹ\u001b[39m Specify the column types or set \u001b[30m\u001b[47m\u001b[30m\u001b[47m`show_col_types = FALSE`\u001b[47m\u001b[30m\u001b[49m\u001b[39m to quiet this message.\n","\n"]},{"name":"stdout","output_type":"stream","text":["Rows: 940\n","Columns: 15\n","$ Id                       \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m 1503960366,