 (Correlation Coefficient > 0), \n","H0- You do not burn calories when you stay active(Correlation Coefficient <= 0), Test- Correlation Test\n","\n","This is in compared with  minutes spend sedentary and calories burned(calculated daily)\n","\n","**Submission**:\n","\n","Although we burn very insignificant calories even while doing nothing, even more positively strong is the hypothesis relationship between staying very active and burning calories.\n","Users should always be notified to stay active when they spend to much time in the sedentary mode. \n","\n","\n","**Third Hypothesis:**\n","Which days are most active days of the week?\n","**Answer**:There wasn't really any great difference during the days of the week.\n","\n","**Fourth Hypothesis:**\n","What are the most active time of the days?\n","\n","**Answer**:Users are mostly active from 7 am to 9pm in the evening.\n","This is the best time to send a notification to remind users to get active especially toward the evening\n","\n","\n","**please note this analysis on sleep and activities covers only 24 unique entries.*\n","\n","**Fifth Hypothesis**\n","H1 Active people sleep longer (Correlation Coefficient > 0), \n","H0-Active people do not sleep longer (Correlation Coefficient <= 0), Test- Correlation Test\n","\n","**Submission**:\n","This correlation shows a negative relationship, therefore ,it most likely means that very active people do not necessarily have longer or better sleep. \n","Users should be prompted to go to bed early for longer and better sleep.\n"]},{"cell_type":"code","execution_count":14,"id":"26f0f84b","metadata":{"execution":{"iopub.execute_input":"2022-03-15T19:09:46.896636Z","iopub.status.busy":"2022-03-15T19:09:46.894076Z","iopub.status.idle":"2022-03-15T19:09:48.950923Z","shell.execute_reply":"2022-03-15T19:09:48.951451Z"},"papermill":{"duration":2.205738,"end_time":"2022-03-15T19:09:48.951618","exception":false,"start_time":"2022-03-15T19:09:46.74588","status":"completed"},"tags":[]},"ou